RegisterNUICallback("requestCrates",function(data, cb)
    local crates = {}
    for k,v in pairs(Config.crate) do
        for i = 1,#v.itens do
            v.itens[i].color = Config.rarityColors[v.itens[i].rarity]
        end
        crates[#crates+1] = v
    end
    cb(crates)
end)

RegisterNUICallback("requestStore",function(data, cb)
    cb(Execute.requestStore())
end)
